public class CCMemoryCacheQueryException extends Throwable {

    public CCMemoryCacheQueryException() {
    }

    public CCMemoryCacheQueryException(String message) {
        super(message);
    }

    public CCMemoryCacheQueryException(String message, Throwable cause) {
        super(message, cause);
    }

    public CCMemoryCacheQueryException(Throwable cause) {
        super(cause);
    }

}
